export function Card (props) {

    function handleClick() {
        props.onClick(props.card);
        console.log(props.cardsList);
    }

    return (
        props.cardsList.map((card, i) => (
                <li key={i} className="card__element">
                    <div className="card">
                        <button className="button button_type_delete" type="button"></button>
                        <img
                            className="photo-grid__item"
                            src={card[i].link}
                            alt="Картинка, которая иллюстрирует название"
                            onClick={handleClick}
                        />
                        <div className="photo-grid__caption">
                            <h2 className="photo-grid__title">{card[i].name}</h2>
                            <div className="photo-grid__wrapper">
                                <button className="button button_type_like" type="button"></button>
                                <span className="photo-grid__like-counter">{card[i].likes.length}</span>
                            </div>
                        </div>
                    </div>
                </li>
            ))
    )
}
